import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
      <div className="row">
        <div className="col-md-8" style={{ border: "solid 3px" }}>
          <h2>Django, React, MongoDB Crud Application</h2>
        </div>
        <div
          className="col-md-4"
          style={{ border: "solid 3px", alignItems: "right" }}
        >
          <Link to="/login" className="nav-link">
            Signup
          </Link>
        </div>
        <Link to="/signup" className="nav-link" style={{ border: "solid 2px" }}>
          Login
        </Link>
      </div>
    </div>
  );
};

export default Header;
